catalog_script_client.script:
function onChange(control, oldValue, newValue, isLoading) {
    if (isLoading || newValue == '') {
        return;
    }

    //Type appropriate comment here, and begin script below
    var name = g_service_catalog.parent.getValue("name");
    var usedFor = g_service_catalog.parent.getValue("used_for");


    if (name == "" && usedFor == "") {
        g_form.setValue("auto_calcualted_name", name + "_" + usedFor);
    }
}
